export default (state = 'NULL', action) => {
  switch (action.type) {
    
    case 'INDEX':
      return action.payload.map(  (item) =>
        <li> 
          {item.id}
          {item.nome}
          {item.desc}
          {item.preco}
        </li>
      );

    default:
      return state;
  }
}
